import React , {useState} from 'react'
import './الملاعب.css' ;



function الملاعب()  {
   
  const [star , setStar ]= useState(false) ;
  const [san , setSan ]= useState(false) ;
  const [sentiage , setSentiage ]= useState(false) ;
  const [elshrouk , setElshrouk ]= useState(false) ;
      return(
        <div className="الملاعب">
         
         
          
         <button onClick={ ()=> { setStar(!star) ; setSan(false)  ; setSentiage(false); setElshrouk(false)   } }  >
           Star Park
         </button>

         <button onClick={()=> { setStar(!star) ; setSan(false)  ; setSentiage(false); setElshrouk(false)   }  }>
           San Sero
         </button>

         <button onClick={()=>{ setStar(!star) ; setSan(false)  ; setSentiage(false); setElshrouk(false)   }}>
           Sentiage
         </button>

         <button onClick={()=>{ setStar(!star) ; setSan(false)  ; setSentiage(false); setElshrouk(false)   }}>
           Elshrouk
         </button>

          <div className="table">
          {
            star? <h1>Starpark</h1> :null
          }
         
           {
            san? <h1>San Sero</h1> :null
          }
            
           {
            sentiage? <h1>Sentiage</h1> :null
          }
          
           {
            elshrouk? <h1>Elshrouk</h1> :null
          }
          
          </div>
          
          
         
         
          
          
        </div>
      
      )
    
  
}

export default الملاعب ;
